INSERT INTO `wp_options` VALUES("541", "page_scroll_to_id_instances", "a:1:{s:17:\"mPS2id_instance_0\";a:32:{s:8:\"selector\";a:10:{s:5:\"value\";s:35:\"a[href*=\'#contact\']:not([href=\'#\'])\";s:6:\"values\";N;s:2:\"id\";s:28:\"page_scroll_to_id_0_selector\";s:10:\"field_type\";s:4:\"text\";s:5:\"label\";s:11:\"Selector(s)\";s:14:\"checkbox_label\";N;s:12:\"radio_labels\";N;s:10:\"field_info\";N;s:11:\"description\";s:662:\"Set the links (in the form of <a href=\"http://www.w3.org/TR/css3-selectors/\" target=\"_blank\">CSS selectors</a>) that will scroll the page when clicked (default value: any link with a non-empty hash (<code>#</code>) value in its URL) <br /><small>In addition to selectors above, the plugin is enabled automatically on links (or links contained within elements) with class <code>ps2id</code></small> <br /><small><a class=\"button button-small mPS2id-show-option-common-values\" href=\"#\">Show common values</a><span>For all links: <code>a[href*=\'#\']:not([href=\'#\'])</code><br />For menu links only: <code>.menu-item a[href*=\'#\']:not([href=\'#\'])</code></span></small>\";s:7:\"wrapper\";N;}s:21:\"autoSelectorMenuLinks\";a:10:{s:5:\"value\";s:4:\"true\";s:6:\"values\";N;s:2:\"id\";s:41:\"page_scroll_to_id_0_autoSelectorMenuLinks\";s:10:\"field_type\";s:8:\"checkbox\";s:5:\"label\";s:0:\"\";s:14:\"checkbox_label\";s:30:\"Enable on WordPress Menu links\";s:12:\"radio_labels\";N;s:10:\"field_info\";N;s:11:\"description\";s:185:\"Automatically enable the plugin on custom links (containing <code>#</code> in their URL) created in Appearance &rarr; Menus <br /><small>Requires WordPress version 3.6 or higher</small>\";s:7:\"wrapper\";s:8:\"fieldset\";}s:15:\"excludeSelector\";a:10:{s:5:\"value\";s:166:\"a[href^=\'#tab-\'], a[href^=\'#tabs-\'], a[data-toggle]:not([data-toggle=\'tooltip\']), a[data-slide], a[data-vc-tabs], a[data-vc-accordion], a.screen-reader-text.skip-link\";s:6:\"values\";N;s:2:\"id\";s:35:\"page_scroll_to_id_0_excludeSelector\";s:10: