";s:8:\"checkbox\";s:5:\"label\";s:0:\"\";s:14:\"checkbox_label\";s:49:\"Stop page scrolling on mouse-wheel or touch-swipe\";s:12:\"radio_labels\";N;s:10:\"field_info\";N;s:11:\"description\";s:127:\"Enable if you want to stop page scrolling when the user tries to scroll the page manually (e.g. via mouse-wheel or touch-swipe)\";s:7:\"wrapper\";s:8:\"fieldset\";}s:17:\"autoCorrectScroll\";a:10:{s:5:\"value\";s:5:\"false\";s:6:\"values\";N;s:2:\"id\";s:37:\"page_scroll_to_id_0_autoCorrectScroll\";s:10:\"field_type\";s:8:\"checkbox\";s:5:\"label\";s:0:\"\";s:14:\"checkbox_label\";s:99:\"Verify target position and readjust scrolling (if necessary), after scrolling animation is complete\";s:12:\"radio_labels\";N;s:10:\"field_info\";N;s:11:\"description\";N;s:7:\"wrapper\";s:8:\"fieldset\";}s:6:\"layout\";a:10:{s:5:\"value\";s:8:\"vertical\";s:6:\"values\";s:24:\"vertical,horizontal,auto\";s:2:\"id\";s:26:\"page_scroll_to_id_0_layout\";s:10:\"field_type\";s:5:\"radio\";s:5:\"label\";s:11:\"Page layout\";s:14:\"checkbox_label\";N;s:12:\"radio_labels\";s:24:\"vertical|horizontal|auto\";s:10:\"field_info\";N;s:11:\"description\";s:346:\"Restrict page scrolling to top-bottom (vertical) or left-right (horizontal) accordingly. For both vertical and horizontal scrolling select <code>auto</code> <br /><small>Please note that \"Layout\" option does not transform your theme&#8217;s templates layout (i.e. it won&#8217;t change your theme/page design from vertical to horizontal).</small>\";s:7:\"wrapper\";s:8:\"fieldset\";}s:6:\"offset\";a:10:{s:5:\"value\";i:0;s:6:\"values\";N;s:2:\"id\";s:26:\"page_scroll_to_id_0_offset\";s:10:\"field_type\";s:4:\"text\";s:5:\"label\";s:6:\"Offset\";s:14:\"checkbox_label\";N;s:12:\"radio_labels\";N;s:10:\"field_info\";s:6:\"pixels\";s:11:\"description\";s:189:\"Offset scroll-to position by x amount of pixels (positive or negative) or by <a href=\"http://www.w3.org/TR/css3-selectors/\" target=\"_blank\">selector</a> (e.g. <code>#navigation-menu</cod